import "./App.css";
import Experience from "./components/experience";
import Skills from "./components/Skills";
import ZakLogo from "./components/ZakLogo";
import AnimatedCursor from "react-animated-cursor";

function App() {
  return (
    <div className="w-max flex">
      <AnimatedCursor
        innerSize={8}
        outerSize={8}
        outerAlpha={0.2}
        innerScale={0.7}
        outerScale={5}
      />

      <ZakLogo />
      <Skills />
      <Experience />
      <div style={{ height: "3000px" }}></div>
    </div>
  );
}

export default App;
